import Image from './Image';
import './App.css';

const url = 'https://cdn.pixabay.com/photo/2017/02/20/18/03/cat-2083492_1280.jpg';
const alternative = 'Cute cat staring';

function App() {
  return (
    <><Image src={url} alt={alternative}/></>
  );
}

export default App;
